import axios from "axios";
import { Component } from "react";

export default class DisplayPlan extends Component {
  constructor() {
    super();
    this.state = {};
  }
  componentDidMount = () => {
    axios
      .post("http://localhost:4000/getCities", this.props.Places)
      .then((RESULT) => {
        this.setState({ planData: RESULT });
      });
  };
  render() {
    return <div></div>;
  }
}
